    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Meadows National Wildlife Refuge outlines Refuge accomplishments during January
    1993. The report begins with a summary of the month's weather conditions. Refuge
    administration is outlined; information about personnel, volunteer programs, and
    safety is given. Habitat management is also covered; subjects include wetlands.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, and raptors. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, wildlife observation, and law enforcement.",nt"owner_org":
